import React, { Component } from "react";
import Header from "../../component/header";
class Transactions extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <Header>
        <span>Page Transactions.</span>
        </Header>
      </div>
    );
  }
}

export default Transactions;
